q_deposit_failed_head:"Mi depsito no pas, lo que debo hacer?",faq_deposit_failed_body:"Si deposit con SKF de pago, es necesario mantener el widget abierto hasta que se ha redirigido. De lo contrario no podemos procesar su depsito.",faq_deposit_failed_solution:"Solucin:",faq_deposit_failed_solution_step_1:"Dirigete a SKFpay.com",faq_deposit_failed_solution_step_2:"Despus de ingresar, ver si hay saldo sin reclamar en la pgina de resumen. Reclamarlo",faq_deposit_failed_solution_step_3:"Ir a la pgina de actividad y cancelar cualquier transaccin pendiente. Esto le devolver esas transacciones a usted.",faq_deposit_failed_solution_step_4:"Entra en la web y deposita de nuevo, pero esta vez utilice el depsito con la opcin de saldo en el widget skfpay.",faq_valve_cases_head:"Son estos las mismas cajas que Valve ofrece?",faq_valve_cases_body:"No, adicionamos skins nosotros mismos a ofrecer aberturas de cajas que son ms gratificantes y ms divertidas para abrir do que Valve o cualquier otro sitio ofrece.",faq_withdraw_status_head:"Dnde puedo seguir el estado de mi solicitud de retirada?",faq_withdraw_status_body:"Solicitud de retiradas pueden ser rastreadas en la pestaa de histrico, en el men principal. Clic en la pestaa de la histria del comercio siguiente. Esto mostrar una listad e todas sus operaciones y sus estados.",faq_open_cases_head:"Cmo puedo abrir las cajas en csgolive?",faq_open_cases_body:'Clic en depsito en el men de la izquierda y use G2APAY para pagar en dinero, o use SKFPAY para pagar con skins. Despus, vaya a cualquier caja que puede pagar y clic en "Abrir Caja"!',faq_skin_colors_head:"Que san esas colores que rodean las skins y por qu son diferentes a cmo las colorea Valve?",faq_skin_colors_body:"Las colores que aparecen se basan en el valor de la skin en relacin con el precio de la caja que se encuentra. As que una skin con un borde amarillo se valora mucho ms que el precio de la caja que se encuentra.",faq_skin_wears_head:"Por qu no tienes todos los estados de skins (por ejemplo Bayoneta ? | Ptina Urbana Recin Fabricada)? Y por qu son algunas skins con desgaste minimo o probadas en campo con una tasa ms baja que las versiones recin fabricadas?",faq_skin_wears_body:"No todos estados de skins estn disponibles y si son, podran ser muy poco frecuente y difcil de obtener. Por lo que ofrecemos lo que las skins son fciles de volver a llenar y tratar de hacer las probabilidades como diversin para el usuario como sea posible..",faq_case_creator_head:"Cmo funciona el creador de cajas?",faq_case_creator_body:"En el creador de cajas, puedes elegir las skins y las probabilidades que desee en su caja. Fijamos el precio de forma automatica usando estadsticas simples y valor esperado. Puede aadir una tasa a su caja y vincularla a otras para sacar ganancias de su caja. Le mostramos las cajas abiertas ms abiertas en la pgina principal y en el navegador de cajas. Tambim puede presentar su caja durante 24 horas mediante el pago de una cuota de $10. Esto pondr su caja en nuestra pgina principal y en la seccin de navegador de cajas, nas cajas destacadas",faq_rigged_head:"Su sitio es manipulado?",faq_rigged_body:"Las probabilidades de nuestras cajas son grandes y mejores que cualquier otro sitio de apertura de cajas. Adems, si no te gusta las probabilidades en nuestras cajas, no dude en utilizar la funcin de creador de cajas para hacer sus proprias cajas y abrirlas!",faq_restock_head:"Qu significa si un item no est disponible o tiene que ser re-abastecido?",faq_restock_body:"Esto significa que este item no est disponible en este momento. Nos re-llenar nuestros items cada 2-3 horas y hacemos todo lo posible para mantener un inventario abastecido. Si no quiere esperar para una re-acciones siempre se puede retirar a skfpay y retirar un equivalente en el almacn..",faq_deposit_before_withdraw_head:"Es necesario que deposite antes de que pueda retirarse en csgolive?",faq_deposit_before_withdraw_body:"Si usted debe comprar $ 5 de crdito con PayPal o skfpay para permitir la retirada..",faq_case_price_changed_head:"Por qu el precio de mi caja cambi?",faq_case_price_changed_body:"Actualizamos los precios de las skins todos los das y esto puede provocar que el precio de las cajas cambien, a medida que el precio de su caja depende de las skins que contiene..",faq_sponsoring_head:"Cmo puedo estar patrocinado por csgolive?",faq_sponsoring_body:"Si usted es un usuario de YouTube con al menos 20.000 subs o 10.000 vistas por vdeo enve un email con el nombre de su canal para partnerships@csgolive.com y decir que est interesado!",faq_prov_fair_tech_head:"Cmo funciona el demonstrablemente honesto? (versin tcnica)",faq_contact_support_head:"Puedo hablar con alguin en csgolive? Mis preguntas no fueron contestadas.",faq_contact_support_body:"No dude en enviar un email a support@csgolive.com!",nav_bar_case_browser:"Navegador de cajas",nav_bar_history:"Historico",logout:"Salir",profile:"Perfil",chat_rules_title:"Reglas de Chat",chat_rules_intro:"Al usar el chat, aceptas las siguientes reglas. Cuando no mantenga las reglas, un mod o un administrador podra prohibirle temporalmente o permanentemente desde nuestras salas de chat.",chat_rules_1:"#1 No vincule su cdigo de afiliado.",chat_rules_2:"#2 No molestar ni insultar a los dems.",chat_rules_3:"#3 No vincule otros sitios de skins de CS:GO.",chat_rules_4:"#4 No pida ayuda en el chat o solicite recargas en skins. Todas las consultas relacionadas con el soporte deben ser enviadas a support@csgolive.com",chat_rules_5:"#5 No enve spam de sus casos personalizados y no utilice ningn tipo de aplicacin de terceros para vincular sus casos en el chat.",chat_rules_6:"#6 No pida skins/dinero.",chat_rules_7:"#7 No insulte.",chat_rules_8:"#8 No le diga que vn a su perfil y observe sus casos.",chat_rules_icons:"Iconos de chat",chat_rules_deposit:"Depositado",inventory_login:"Esta pgina estar disponible una vez que inicie sesin.",inventory_show_settings:"Ajustes de la presentacin",inventory_fail