led_solution_step_2:"Kai prisijungi, pairk ar yra neatsiimto balanso pagrindiniame puslapyje.",faq_deposit_failed_solution_step_3:"Eik  veiklos puslap ir atauk laukiamos transakcijos. Tai sugrins transakcijos jums.",faq_deposit_failed_solution_step_4:"Eik  ms puslap ir pabandyk deponuoti ir vl, bet  kart naudok deponuoti su balansu nustatym, SKFpay valdyklje..",faq_valve_cases_head:"Ar ios ds tokios pat kaip Valve ds?",faq_valve_cases_body:"Ne, mes surinkome visokius skinus patys, kad pasilyti monms di kurios yra daug labiau apdovanojamos ir domesns, geresns nei Valve ds ar bet kokio kito puslapio.",faq_withdraw_status_head:"Kur galiu pairti savo atsimimo praymo status?",faq_withdraw_status_body:"Atsimimo praymus einant  istorijos puslap pagrindiniame puslapyje, ir tada jungiant atsimimo. Tai parodys jums visus js tradus ir j statusus.",faq_open_cases_head:"Kaip galiu atidaryti des ant csgolive??",faq_open_cases_body:'Spausk deponuoti, kairje pagrindiniame puslapyje, ir tada naudok G2A kad mokti su pinigais arba SKFPay kad mokti su skinais. Tada eik  bent kokia d ir spausk "atidaryti" kad atidaryti d!',faq_skin_colors_head:"Kodl aplink skinus yra keistos spalvos, ir kodl jos yra kitokios nei Valve dse?",faq_skin_colors_body:"Spalvos yra pagrstos ant skino kainos ir taip pat pagrstos ant ds kainos/procent. Geltonos spalvos rmeliai reikia kad skinas yra daug kart vertingesnis u paia d.",faq_skin_wears_head:"Kodl neturite vis skin? (i.e Bayonet | Urban Masked Factory New)? ir kodl kai kurie minimal wear skinai ar field-tested skinai turi emesnius laimjimo procentus nei factory new skinai?",faq_skin_wears_body:"Nevisi skinai yra tokie prieinami ir jeigu ir yra, tada reikia kad jie nepatinka monms ar tiesiog sunkiai gaunami. Todl mes silome jums tokius skinus, kuriuos galima lengvai papildyti, kad jums nereikt ilgai laukti, ir bandom padaryti procentus kuo geresnius.",faq_case_creator_head:"Kaip veikia di krimas?",faq_case_creator_body:"Kuriant d gali pasirinkti procentus ir skinus kurios nori. Mes automatikai nustatome ds kain, naudojant paprast statistik ir tinkamiausi kain. Tu gali jungti mokesi sistem savo dje ir nusisti kitiems monms, tada TU gausi pinig. Mes rodome daugiausiai atidarytas des di skyriuje . Tu taip pat gali teminti savo d 24 valandoms, mokant 10$ rinkliav . Tai padarys kad tavo d rodyt pagrindiniame puslapyje ir di skyriuje - teminiai.",faq_rigged_head:"Ar js puslapis suklastotas/rigged?",faq_rigged_body:"Procentai per CSGOLives des yra geri, geresni nei bent kokio kito di atidarymo puslapio. O jeigu vis tiek jums nepatinka ms procentai, naudok ms di krimo ypatyb kad sukurti savo paties d su savo paties procentais!",faq_restock_head:"K tai reikia, jeigu skinas yra negalimas?",faq_restock_body:"Tai reikia kad skinas iuo metu yra negalimas. Mes papildome skinus kas 2~3 valandas ir darome k galime kad skinus galtumet atsiimti ikart. Jeigu nenorite laukti kol skinus papildysime, visada galite pervesti skinus  SKFPay balans ir atsiimti skin is j parduotuves.",faq_deposit_before_withdraw_head:"Ar reikia deponuoti kad atsiimti skinus i csgolive?",faq_deposit_before_withdraw_body:"Taip, privalai deponuoti 5 eur verts skin, arba nupirkti 5 kreditus naudojant pinigus kad gauti prieinamum prie atsimimo sistemos.",faq_case_price_changed_head:"Kodl mano skin kainos pasikeit?",faq_case_price_changed_body:"Mes atnaujiname skin kainas kiekvien dien, tai gali pakeisti tavo skino kain, nes skino kaina priklauso nuo paio skino, ne nuo ms.",faq_sponsoring_head:"Kaip galiu bti paremtas nuo csgolive?",faq_sponsoring_body:"Jeigu esi youtuberis su bent 20 tkstani prenumeratori ir 10 tkstani periru per video, tada susisiek su mumis per elektronin pat partnerships@csgolive.com, btinai parayk detaliai, su youtubes kanalu ir viskuom, btinai susitarsim!",faq_prov_fair_tech_head:'Kaip "Kaip veikia" veikia? (Technin versija)',faq_contact_support_head:"Ar galiu pakalbti su kakuom per csgolive? Man reikia pagalbos, atsakymo ia neradau.",faq_co